t behov, inkludert brukertilpassede layouter og stiler.','New User Primer'=>'Introduksjon for nye brukere','CSV Import Settings'=>'Innstillinger for CSV-import','Clear'=>'Nullstill','Unnamed %s'=>'Navnløse %s','Add another %s'=>'Legg til ny %s','Create New %s'=>'Opprett ny %s','Please note that all hands-on support is provided via the help desk. You can email or tweet at us… ​but we will probably point you back to the help desk 😄'=>'Vennlist merk at all direkte støtte blir gitt via våre forum. Du kan sende epost eller en tweet til oss... men vi vil sannsynligvis henvise deg tilbake til forumene 😄','Read more about our support policy'=>'Les mer om våre regler for hjelp og støtte','%s. There are very few issues we haven’t seen and it’s likely another user has already asked your question and gotten an answer from our support staff. While posting to the help desk is open only to paid customers, they are open for anyone to search and review.'=>'%s. Det er veldig få problemer vi ikke har sett før, og det er sannsynlig at en annen bruker allerede har stilt samme spørsmål, samt fått svar fra vår støttestab. Selv om det er forbeholdt våre premiumbrukere å skrive innlegg på forumene, er det fritt for alle å søke og lese der.','%s. All of the common (and not-so-common) answers to questions we see are here. It’s often the fastest path to finding an answer!'=>'%s. Alle de mest vanlige (og ikke fullt så vanlige) svarene på spørsmål som vi mottar er her. Det er ofte den raskeste veien til å finne et svar!','Check our Knowledgebase'=>'Sjekk ut vår kunnskapsbase','%s. Testing for an existing conflict is the best start for in-depth troubleshooting. We will often ask you to follow these steps when opening a new thread, so doing this ahead of time will be super helpful.'=>'%s. Å teste for en eksisterende konflikt er den beste begynnelsen for feilsøking i dybden. Vi vil ofte be deg følge disse trinnene når du starter en ny tråd, så å gjøre dette på forhånd vil være veldig hjelpsomt.','Test for a theme or plugin conflict'=>'Test for konflikt med et tema eller en utvidelse','Our website’s %s is a great place to find tips and tricks for using and customizing our plugins.'=>'Vår hjemmesides %s er et flott sted å finne tips og triks for hvordan du tar i bruk og brukertilpasser vår utvidelse.','Knowledgebase'=>'Kunnskapsbase','list of available functions'=>'liste over tilgjengelige funksjoner','While the resources above help solve a majority of the issues we see, there are times you might be looking for extra support. If you need assistance using our plugins and would like us to take a look, please follow these steps:'=>'Mens ressursene over vil hjelpe deg med hovedvekten av problemer vi oppdager, kan det være at du noen ganger trenger ekstra hjelp. Hvis du behøver assistanse med å bruke våre utvidelser og vil at vi skal ta en titt på det, vennligst følg disse stegene:','Getting More Help'=>'Få mer hjelp','Getting Support'=>'Få hjelp','Thank you for using %s! All of us at The Events Calendar sincerely appreciate your support and we’re excited to see you using our plugins.'=>'Takk for at du bruker %s! Alle vi hos The Events Calendar setter pris på din støtte, og vi er glade for at du bruker vår utvidelse.','Install Plugin'=>'Installer utvidelse','Active Users:'=>'Aktive brukere:','Rating:'=>'Vurdering:','Plugin Active'=>'Utvidelse aktiv','Plugin Inactive'=>'Utvidelse deaktivert','Visit the Add-on Page'=>'Besøk utvidelsens side','Thanks for setting up a valid key. It will expire on %s'=>'Takk for at du satte opp en gyldig nøkkel. Den utløper %s','Upgrade Plugin'=>'Oppgrader innstikk','Install %s'=>'Installer %s','Activate Plugin'=>'Aktiver utvidelse',' and '=>' og ','Activate %s'=>'Aktiver %s','Event Tickets'=>'Event Tickets','Advanced Post Manager'=>'Avansert innlegg manager','Event Tickets Plus'=>'Event Tickets Plus','Community Tickets'=>'Community Tickets','Eventbrite Tickets'=>'Eventbrite-billetter','Facebook Events'=>'Facebook arrangement','Events Ti